import { Tabs,Box,Tab  } from '@mui/material';
import React, { useState } from 'react';
import { Link, NavLink, useParams } from "react-router";
import "../../App.scss";

const RestaurantPage = () => {
  let { id } = useParams();

  return (
    <div>
      <div style={{
        display: 'flex',
        flexDirection: 'row'
      }}>
        <div style={{
          flex: 2
        }}>
          <h1 className="bold-text title">McDonald's® (Adams  Wells)</h1>
          <p className="subtitle">
            Chinese
            Dim Sum
            Noodles
            Thai
            Open until 22:45
            £4.49 delivery
            £7.00 minimum
            1.94 miles away
            107 Lever Street, London, EC1V3RQ
            View map
          </p>
        </div>

        <div
          style={{
            flex: 1,
          }}>

          <img
            style={{
              height: '100%',
              width: '100%'
            }}
            src="https://cdn.concreteplayground.com/content/uploads/2020/04/Family-Feast-KFC-supplied.jpg" />
        </div>

      </div>

      <div style={{ flex: 1 }}>
        <div style={{ height: '100px', width: '100%' }}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
            <Tabs>
              <Tab label="Item One"  />
              <Tab label="Item Two"/>
              <Tab label="Item Three"  />
            </Tabs>
          </Box>

        </div>
      </div>
    </div >
  );
}
export default RestaurantPage
